import React from 'react';

const Careers = () => {
    return (
        <div className="container m-5 justigy-content-center">
            <h3 className="font-weight-bold">COME WORK WITH US</h3>
            <p>We are constantly looking out to hire competent and experience talent to be part of our team.</p>
            <p>If you have the relevant expereince and the passion to be part of our team, please feel free to drop an email to us at <span className="text-info">contact@hacconsulting.com</span></p>
        </div>
    );
};

export default Careers;
